			obj.value = item;
			obj.desc = item;
			obj.code = index;
		} else {
			obj.text = item.desc;
			obj.value = item.desc;
			obj.desc = item.desc;
			obj.code = item.code;
		}
		arr.push(obj);
	});
	return arr;
}

